import React from 'react';
import axios from 'axios';

export const fetchApiDoctors = async (payload) => {
  try {
    let res = await axios.post(`http://localhost:3000/doctors`, payload);
    return res.data;
  } catch (err) {
    console.log('This is your error:', err);
    throw err;
  }
};


export const createReviews = async (place_id, doctor_id) => {
  const reviewPayload = {
    place_id,
    doctor_id,
  };

  try {
    let res = await axios.post('http://localhost:3000/reviews', reviewPayload);
    return res.data;
  } catch (error) {
    console.log(error);
    throw error;
  }
};

export const createPhotos = async (doctor_reference, doctor_id) => {
  const photoHash = {
    doctor_id,
    doctor_reference,
  };

  try {
    let res = await axios.post(`http://localhost:3000/photos`, photoHash);
    return res.data;
  } catch (err) {
    console.log(err);
    throw err;
  }
};

export const getDocsAfterSearch = async (apidocs) => {

  try {
    let allDocs = await axios.get(`http://localhost:3000/doctors`)

    let searchedDocs = allDocs.filter(doc => apidocs.includes(doc.id))
    return searchedDocs
  } catch (error) {

  }
  console.log(allDocs)
  console.log(searchedDocs)
}
